import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

const Realisations = () => {
    return (
        <section id="#Realisations">
            <Navbar />
            <h3>Découvrez mes projets réalisés, qui mettent en avant mon expertise en matière de développement web.</h3>
            <object data={process.env.PUBLIC_URL + "project/iss09_php_version/index.php"} title="Mon projet"></object>
            <Footer />
        </section>
    )
}

export default Realisations;
